actionConfiguration.body:
() => {
		var result = appsmith.store.ShipmentsToAdd
		if (result == null) {
			result = []
		}
		if (checkboxAddToShipment.isChecked) {
			let toAdd = {
				"id": listCreateDeliveryShipment.selectedItem.id
			}
			result.push(toAdd)
		} else {
			var newResult = []
			for (let i = 0; i < result.length; i ++) {
				if (result[i].id != listCreateDeliveryShipment.selectedItem.id) {
					newResult.push(result[i])
				}
			}
			result = newResult
		}

		storeValue("ShipmentsToAdd", result)
		return result
	}

